import React, { Component } from 'react';

export class Home extends Component {
  static displayName = Home.name;

  render () {
    return (
      <div>
        <h1>Itunes Search</h1>
            <p>Search Here:</p>
            <input type="text"></input>
            <button type="submit">Search</button>
      </div>
    );
  }
}
